import React from "react";

function NameButtons(props) {
    return (
        <div id="NameButtons">
            <button onClick={() => playerJoin("Ethan")}>Ethan</button>
            <button onClick={() => props.setName("Cole")}>Cole</button>
            <button onClick={() => props.setName("Nathan")}>Nathan</button>
        </div>
    );
}

export default NameButtons;
